style.css:
@-moz-document domain(logs.blackrussia.online){
:root {
  --bs-body-bg: #212529;
}
h1, h2, h3, h4, h5, h6 {
    color: #fff;
}
#log-table[data-v-2d76ca92] th[data-v-2d76ca92] {
    border: 1px solid #000;
}
#log-table[data-v-2d76ca92], .table {
    --bs-table-bg: #414448;
    --bs-table-accent-bg: transparent;
    --bs-table-striped-color: #212529;
    --bs-table-striped-bg: rgba(0,0,0,0.05);
    --bs-table-active-color: #212529;
    --bs-table-active-bg: rgba(0,0,0,0.1);
    --bs-table-hover-color: #212529;
    --bs-table-hover-bg: rgba(0,0,0,0.075);
    border-color: #000;
    color: #fff;
    margin-bottom: 1rem;
    vertical-align: top;
    width: 100%;
}
#log-table[data-v-2d76ca92]>:not(caption)>*>*, .table-borderless>:not(caption)>*>* {
    border-bottom-width: 1;
}
#log-table[data-v-2d76ca92]>:not(caption)>*>*, .table>:not(caption)>*>* {
    background-color: var(--bs-table-bg);
    border-bottom-width: 1px;
    box-shadow: inset 0 0 0 9999px var(--bs-table-accent-bg);
    padding: 0.5rem;
    border: 1px solid #000;
}
#log-table[data-v-2d76ca92] .first-row[data-v-2d76ca92] td[data-v-2d76ca92] {
    border: 1px solid #000;
    text-align: center;
}
td.td-transaction-desc {
    background: linear-gradient(90deg, rgb(65, 68, 72), rgb(0, 0, 0));
}
.td-player-name[data-v-2d76ca92] a[data-v-2d76ca92] {
    color: #0ff;
    text-decoration: none;
}
.td-category[data-v-2d76ca92] a[data-v-2d76ca92] {
    color: #aaaaff;
    font-style: italic;
    text-decoration: none;
}
#log-table[data-v-2d76ca92] th[data-v-2d76ca92] {
    font-weight: 500;
    padding-bottom: 0.6rem;
    text-align: center;
    border: 1px solid #fff;
}
#log-filter[data-v-2d76ca92] {
    border-radius: 4px;
    background: linear-gradient(180deg, rgb(65, 68, 72), rgb(0, 0, 0));
    height: 51.5rem;
    margin: 0;
    padding: 1rem;
}
#log-filter-section[data-v-2d76ca92] {
    background: #212529;
    border: 1px solid #000;
    border-radius: 10px;
    height: calc(100vh - 90px);
    margin-left: 1rem;
    min-width: 20rem;
    overflow-y: auto;
    position: -webkit-sticky;
    position: sticky;
    top: 44px;
}
.autoComplete_wrapper>input {
    background-color: #212529;
    background-origin: border-box;
    background-position: left 1.05rem top 0.8rem;
    background-repeat: no-repeat;
    background-size: 1.4rem;
    border: 0.05rem solid #f00;
    border-radius: 10px;
    box-sizing: border-box;
    color: #f00;
    font-size: 1rem;
    height: 2.45rem;
    margin: 0;
    outline: none;
    padding: 0 1rem;
    text-overflow: ellipsis;
    transition: all .4s ease;
    width: 100%;
}
.form-control {
    -webkit-appearance: none;
    -moz-appearance: none;
    appearance: none;
    background-clip: padding-box;
    background-color: #212529;
    border: 1px solid #000;
    border-radius: 10px;
    color: #fff;
    display: block;
    font-size: 1rem;
    font-weight: 400;
    line-height: 1.5;
    padding: 0.375rem 0.75rem;
    transition: border-color .15s ease-in-out,box-shadow .15s ease-in-out;
    width: 100%;
}
.multiselect-search {
    -webkit-appearance: none;
    -moz-appearance: none;
    appearance: none;
    background: var(--ms-bg,#212529);
    border: 0;
    border-radius: var(--ms-radius,10px);
    bottom: 0;
    box-sizing: border-box;
    font-family: inherit;
    font-size: inherit;
    left: 0;
    outline: none;
    padding-left: var(--ms-px,.875rem);
    position: absolute;
    right: 0;
    top: 0;
    width: 100%;
		color: #fff;
}
.dp__theme_light {
    --dp-background-color: #212529;
    --dp-text-color: #fff;
    --dp-hover-color: #636669;
    --dp-hover-text-color: #eee;
    --dp-hover-icon-color: #959595;
    --dp-primary-color: #1976d2;
    --dp-primary-disabled-color: #6bacea;
    --dp-primary-text-color: #f8f5f5;
    --dp-secondary-color: #c0c4cc;
    --dp-border-color: #000;
    --dp-menu-border-color: #000;
    --dp-border-color-hover: #aaaeb7;
    --dp-disabled-color: #111;
    --dp-scroll-bar-background: #111;
    --dp-scroll-bar-color: #444;
    --dp-success-color: #76d275;
    --dp-success-color-disabled: #a3d9b1;
    --dp-icon-color: #fff;
    --dp-danger-color: #ff6f60;
    --dp-marker-color: #ff6f60;
    --dp-tooltip-color: #fafafa;
    --dp-disabled-color-text: #8e8e8e;
    --dp-highlight-color: rgb(25,118,210);
}
.input-group-text {
    align-items: center;
    background-color: #636669;
    border: 1px solid #000;
    border-radius: 10px;
    color: #000;
    display: flex;
    font-size: 1rem;
    font-weight: 400;
    line-height: 1.5;
    padding: 0.375rem 0.75rem;
    text-align: center;
    white-space: nowrap;
}
.multiselect .multiselect-option.is-pointed.is-selected {
    color: #fff;
    background: linear-gradient(90deg, rgb(135, 138, 140), rgb(33, 37, 41));
}
.multiselect .multiselect-option.is-pointed {
    color: #fff;
    background: linear-gradient(90deg, rgb(135, 138, 140), rgb(33, 37, 41));
}
.multiselect .multiselect-option.is-selected {
    color: #fff;
    background: linear-gradient(90deg, rgb(99, 102, 105), rgb(0, 0, 0));
}
.multiselect-option {
    align-items: center;
    box-sizing: border-box;
    cursor: pointer;
    background: linear-gradient(90deg, rgb(33, 37, 41), rgb(0, 0, 0));
    color: #aaaaaa;
    display: flex;
    font-size: var(--ms-option-font-size,1rem);
    justify-content: flex-start;
    line-height: var(--ms-option-line-height,1.375);
    padding: var(--ms-option-py,.5rem) var(--ms-option-px,.75rem);
    text-align: left;
}
.dropdown-item {
    background-color: transparent;
    border: 0;
    clear: both;
    color: #fff;
    display: block;
    font-weight: 400;
    padding: 0.25rem 1rem;
    text-align: inherit;
    text-decoration: none;
    white-space: nowrap;
    width: 100%;
}
.dropdown-menu {
    background-clip: padding-box;
    background: linear-gradient(90deg, rgb(99, 102, 105), rgb(0, 0, 0));
    border: 1px solid rgba(0,0,0,.15);
    border-radius: 0.25rem;
    color: #fff;
    display: none;
    font-size: 1rem;
    list-style: none;
    margin: 0;
    min-width: 10rem;
    padding: 0.5rem 0;
    position: absolute;
    text-align: left;
    z-index: 1000;
}
.autoComplete_wrapper>input {
    background-color: #212529;
    background-origin: border-box;
    background-position: left 1.05rem top 0.8rem;
    background-repeat: no-repeat;
    background-size: 1.4rem;
    border: 0.05rem solid #f00;
    border-radius: 10px;
    box-sizing: border-box;
    color: #f00;
    font-size: 1rem;
    height: 2.45rem;
    margin: 0;
    outline: none;
    padding: 0 1rem;
    text-overflow: ellipsis;
    transition: all .4s ease;
    width: 100%;
}
.autoComplete_wrapper>ul>li {
    color: #fff;
    background: linear-gradient(90deg, rgb(33, 37, 41), rgb(0, 0, 0));
    font-size: 1rem;
    margin: 0;
    overflow: hidden;
    padding: 0.3rem 0.5rem;
    text-align: left;
    text-overflow: ellipsis;
    transition: all .2s ease;
    white-space: nowrap;
}
.input-group>:not(:first-child):not(.dropdown-menu):not(.valid-tooltip):not(.valid-feedback):not(.invalid-tooltip):not(.invalid-feedback):not(.field-error) {
    border-bottom-left-radius: 0;
    border-top-left-radius: 0;
    margin-left: -1px;
    background-color: #212529;
    color: #fff;
}
.form-control:focus {
    background-color: #212529;
    border-color: #86b7fe;
    box-shadow: 0 0 0 0.25rem rgb(13,110,253);
    color: #fff;
}
.lookup-comment[data-v-2d76ca92] {
    color: #fff;
    font-size: .9rem;
    font-weight: 400;
}
#placeholder-msg[data-v-9c1e68e2] {
    color: #f00;
    font-size: 1.25rem;
    padding: 1rem;
    text-align: center;
}
#placeholder-pic[data-v-9c1e68e2] {
    display: block;
    opacity: 0;
    margin: auto;
    max-height: 20rem;
}
#content-placeholder[data-v-9c1e68e2] {
 		background-image: url(https://imgur.com/9XN2j2i.png);
    background-repeat: no-repeat;
    background-size: contain;
    background-position: center;
}
#loading-overlay[data-v-173ec149] .spinner[data-v-173ec149] {
    border-width: 0.375rem;
    color: #000;
    height: 4rem;
    width: 4rem;
}
#loading-overlay-heading[data-v-173ec149] {
    color: #000;
    font-size: 2rem;
    font-weight: 500;
    letter-spacing: 1px;
    padding: 1rem;
    text-align: center;
    text-transform: uppercase;
}
#loading-overlay-container[data-v-173ec149] {
    align-items: center;
    display: flex;
    flex-direction: column;
    height: 100%;
    justify-content: center;
    width: 100%;
    background-color: rgba(0,0,0,0.7);
}
.bi-sort-down::before {
    content: "\f575";
    color: #0ff;
}
}
